import { Avatar, Box, Card, CardContent, Grid, Typography } from '@mui/material';
import Checkbox from '@mui/material/Checkbox';
export const CreateIntegration = (props) => (
  
    <CardContent>
      <Grid
        container
        spacing={3}
        sx={{ justifyContent: 'space-between' }}
      >
        <Grid item>
          <Typography
            color="textSecondary"
            gutterBottom
            variant="overline"
          >
            Criar integração
          </Typography>
         
        </Grid>
        
      </Grid>
      
        
    </CardContent>
 
);
